	private int max_length = 0;
	private int[] indices = new int[256];
	
	public NonRepeatedSubString() {
		clearIndices();
	}
	
	public int lengthOfLongestSubstring(String s) {
		// char[] array = s.toCharArray();
		
		int size = s.length();
		if (size == 1) {
			recordLength(1);
			return max_length;
		}
		
		int start = 0;
		int end = 1;		
		int last = size - 1;
		indices[s.charAt(start)] = 0;
		
		while (end <= last) {
			char ch = s.charAt(end);
			if (indices[ch] != -1) {
				recordLength(end - start);
				start = end;
				clearIndices();
			}
			
			end++;
		}
		
		return max_length;
    }
	
	private void clearIndices() {
		for (int i = 0; i < indices.length; i++) {
			indices[i] = -1;
		}
	}
	
	private void recordLength(int length) {
		if (max_length < length) {
			max_length = length;
		}
	}
